import React, {Component} from 'react';

class Main extends Component{
    constructor(props){
        super(props);
        this.state = {
            title: "Menu Makanan"
        }
    }
    render(){
        return(
            <div>
                <h3>{this.state.title}</h3>
                <button>Rubah Data</button>
            </div>
        )
    }
}

export default Main;
